// App.jsx
import React, { useState, useEffect } from "react";
import axios from "axios";

const API_BASE = "http://localhost:5000/api";

function App() {
  const [message, setMessage] = useState("");
  const [chatLog, setChatLog] = useState([]);
  const [streak, setStreak] = useState(0);
  const [journal, setJournal] = useState([]);
  const [shop, setShop] = useState([]);
  const [health, setHealth] = useState(null);

  // Fetch streak and journal on load
  useEffect(() => {
    axios.get(`${API_BASE}/streak`).then((res) => setStreak(res.data.streak));
    axios.get(`${API_BASE}/journal`).then((res) => setJournal(res.data.entries));
    axios.get(`${API_BASE}/shop`).then((res) => setShop(res.data.items));
    axios.get(`${API_BASE}/health`).then((res) => setHealth(res.data));
  }, []);

  // Handle chat send
  const sendMessage = async () => {
    if (!message) return;
    const userMsg = { sender: "You", text: message };
    setChatLog([...chatLog, userMsg]);
    setMessage("");

    try {
      const res = await axios.post(`${API_BASE}/chat`, { message });
      const botMsg = {
        sender: "MoodMate",
        text: res.data.reply,
        mood: res.data.mood,
        quote: res.data.quote,
        audio: res.data.audio_url,
      };
      setChatLog((prev) => [...prev, botMsg]);

      // Play audio if available
      if (botMsg.audio) {
        const audio = new Audio(`http://localhost:5000${botMsg.audio}`);
        audio.play();
      }
    } catch (err) {
      console.error(err);
      alert("Error sending message");
    }
  };

  // Add journal entry
  const addJournal = async () => {
    if (!message) return;
    await axios.post(`${API_BASE}/journal`, { text: message });
    const res = await axios.get(`${API_BASE}/journal`);
    setJournal(res.data.entries);
    setMessage("");
  };

  return (
    <div style={{ fontFamily: "Arial", padding: "20px" }}>
      <h1>🌙 MoodMate</h1>
      <p>Daily Streak: <b>{streak}</b></p>
      <p>Status: {health ? "✅ Online" : "❌ Offline"}</p>

      {/* Chat Section */}
      <div style={{ border: "1px solid gray", padding: "10px", marginBottom: "20px" }}>
        <h2>💬 Chat</h2>
        <div style={{ height: "200px", overflowY: "auto", background: "#f9f9f9", padding: "10px" }}>
          {chatLog.map((msg, idx) => (
            <div key={idx} style={{ marginBottom: "8px" }}>
              <b>{msg.sender}:</b> {msg.text}
              {msg.mood && <i> ({msg.mood})</i>}
              {msg.quote && <div style={{ color: "blue" }}>✨ {msg.quote}</div>}
            </div>
          ))}
        </div>
        <input
          value={message}
          onChange={(e) => setMessage(e.target.value)}
          placeholder="Type your message..."
          style={{ width: "70%", padding: "5px" }}
        />
        <button onClick={sendMessage}>Send</button>
        <button onClick={addJournal}>Save to Journal</button>
      </div>

      {/* Journal Section */}
      <div style={{ border: "1px solid gray", padding: "10px", marginBottom: "20px" }}>
        <h2>📔 Journal</h2>
        {journal.map((entry) => (
          <div key={entry.id} style={{ marginBottom: "8px" }}>
            <b>{entry.mood || "note"}:</b> {entry.text} <i>{entry.created_at}</i>
          </div>
        ))}
      </div>

      {/* Shop Section */}
      <div style={{ border: "1px solid gray", padding: "10px", marginBottom: "20px" }}>
        <h2>🛍️ Shop</h2>
        {shop.map((item) => (
          <div key={item.id}>
            <b>{item.name}</b> - {item.description} ({item.price} coins)
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
